import { createUseStyles } from 'react-jss';
var useSpacingStyles = createUseStyles({
    xxsmall: {
        minWidth: 2.5,
    },
    xsmall: {
        minWidth: 5,
    },
    small: {
        minWidth: 10,
    },
    medium: {
        minWidth: 15,
    },
    large: {
        minWidth: 20,
    },
    xlarge: {
        minWidth: 25,
    },
    xxlarge: {
        minWidth: 30,
    },
    'horizontal-xxsmall': {
        minWidth: 2.5,
    },
    'horizontal-xsmall': {
        minWidth: 5,
    },
    'horizontal-small': {
        minWidth: 10,
    },
    'horizontal-medium': {
        minWidth: 15,
        background: 'red'
    },
    'horizontal-large': {
        minWidth: 20,
    },
    'horizontal-xlarge': {
        minWidth: 25,
    },
    'horizontal-xxlarge': {
        minWidth: 30,
    },
});
export { useSpacingStyles, };
